  summary: >-
    The <xref href="NDSH.Geospatial.Gml.Temporal.RelatedTimeType" data-throw-if-not-resolved="false"></xref> provides a content model for indicating the relative position of

    an arbitrary member of the substitution group whose head is <xref href="NDSH.Geospatial.Gml.Temporal.AbstractTimePrimitiveType" data-throw-if-not-resolved="false"></xref>.

    It extends the generic <xref href="NDSH.Geospatial.Gml.Temporal.TimePrimitivePropertyType" data-throw-if-not-resolved="false"></xref> with a <xref href="NDSH.Geospatial.Gml.Temporal.RelatedTimeType.RelativePosition" data-throw-if-not-resolved="false"></xref> property

    (XML attribute relativePosition), whose value is selected from the set of

    <a href="https://en.wikipedia.org/wiki/Allen%27s_interval_algebra">

    13 temporal relationships identified by Allen (1983)

    </a>.
  remarks: 'Maps to: <code>RelatedTimeType</code> ( /2005/gml/temporal.xsd )'
