  summary: >-
    <p>
      Gets/Sets the relative position of a temporal primitive with respect to another.
    </p>

    <p>
      The value is one of the 13 temporal relationships defined by Allenâ€™s interval algebra,
      such as <xref href="NDSH.Geospatial.Gml.Temporal.RelatedTimeRelativePosition.Before?text=Before" data-throw-if-not-resolved="false"></xref>,
      <xref href="NDSH.Geospatial.Gml.Temporal.RelatedTimeRelativePosition.After?text=Afer" data-throw-if-not-resolved="false"></xref>,
      <xref href="NDSH.Geospatial.Gml.Temporal.RelatedTimeRelativePosition.During?text=During" data-throw-if-not-resolved="false"></xref>,
      or <xref href="NDSH.Geospatial.Gml.Temporal.RelatedTimeRelativePosition.Overlaps?text=Overlaps" data-throw-if-not-resolved="false"></xref>.
    </p>
  remarks: This property corresponds to the XML attribute <code>relativePosition</code> in GML.
  example: []
  syntax:
    content: >-
      [JsonProperty("relativePosition")]

      public RelatedTimeRelativePosition RelativePosition { get; set; }
